<body>
  <h1>Cubic Time Complexity Function</h1>
    <script>
  function traverse(obj) {
  for (let key in obj) {
    const value = obj[key];

    if (typeof value === "object" && value !== null) {
      traverse(value); // go deeper
    } else {
      console.log(value); // primitive value
    }
  }
}

function sum(arr) {
  let total = 0;
  for (let x of arr) {
    total += x;
  }
  return total;
}

function count(arr) {
  let total = 0;
  for (let i = 0; i < arr.length; i++) {
    total++;
  }
  return total;
}
function duplicate(arr) {
  let result = [];
  for (let x of arr) {
    result.push(x);
  }
  return result;
}


    </script>
